a como una de las más fieles del fútbol argentino. ¡Vamos Belgrano carajo!',1,'2024-04-01',6,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(12,'?️ Aniversario del Estadio','Recordamos la inauguración de nuestro querido estadio Julio César Villagra el 21 de septiembre de 1940. La casa del Pirata en el barrio Alberdi.',1,'2024-09-21',6,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(13,'⚔️ Derby Cordobés - Fecha Especial','Recordamos los grandes clásicos contra Talleres. La rivalidad más importante del fútbol cordobés que divide a la provincia en dos colores.',1,'2024-05-15',6,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(14,'? 120° Aniversario de Belgrano','120° Aniversario de la fundación del Club Atlético Belgrano. Celebración especial por los 120 años de historia pirata.',1,'2025-03-19',6,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(15,'⚽ 14° Aniversario del Ascenso Histórico','14° Aniversario del histórico ascenso vs River Plate. Una fecha que quedó grabada para siempre en la historia del fútbol argentino.',1,'2025-06-26',6,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(19,'Belgrano vs San Lorenzo','Duelo de tradición. Liga Profesional 2025 - Fecha 28. Dos equipos históricos del fútbol argentino.',1,'2025-09-01',1,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(21,'Presentación de refuerzos 2025','Presentación oficial de los nuevos refuerzos para la segunda mitad del año. Conferencia de prensa con la dirigencia y firma de contratos en la sede del club.',1,'2025-07-10',3,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(22,'Festival Pirata 2025','Cuarta edición del Festival Pirata con shows en vivo, actividades familiares y gastronomía. En los predios del club desde las 14:00 horas.',1,'2025-07-20',2,1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(23,'Entrenamiento abierto pre-Derby','Práctica abierta al público previa al Derby Cordobés. Los socios podrán ingresar gratuitamente y alentar al plantel.',1,'2025-08-14',4,1,'2025-06-27 05:29:05','2025-06-27 05:29: