INSERT INTO `map_locations` VALUES (1,'Estadio Julio César Villagra','Av. Arturo Orgaz 510, Córdoba, Argentina','Estadio oficial del Club Atlético Belgrano. Capacidad para 28,000 espectadores. Casa de los Piratas Celestes.','https://maps.google.com/?q=Estadio+Julio+Cesar+Villagra+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(2,'Sede Social Club Atlético Belgrano','Av. Arturo Orgaz 500, Córdoba, Argentina','Sede social principal del club con oficinas administrativas, salones de eventos y museo del club.','https://maps.google.com/?q=Sede+Social+Belgrano+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(3,'Complejo Deportivo Los Boulevares','Los Boulevares, Córdoba, Argentina','Complejo de entrenamiento con canchas de fútbol, gimnasio y facilities para divisiones inferiores.','https://maps.google.com/?q=Complejo+Los+Boulevares+Belgrano+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(4,'Primer Estadio Belgrano (Barrio Alberdi)','Barrio Alberdi, Córdoba, Argentina','Ubicación del primer estadio del club, donde se jugaron los primeros partidos históricos antes de la mudanza al actual estadio.','https://maps.google.com/?q=Barrio+Alberdi+Cordoba+Argentina',1,0,'2025-06-24 21:30:38','2025-06-27 13:08:59'),(5,'Casa de Fundación del Club','Av. Colón, Córdoba, Argentina','Lugar aproximado donde se fundó el Club Atlético Belgrano el 19 de marzo de 1905.','https://maps.google.com/?q=Avenida+Colon+Cordoba+Capital',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(6,'Tienda Oficial Belgrano - Patio Olmos','Patio Olmos Shopping, Av. Vélez Sarsfield 361, Córdoba, Argentina','Tienda oficial del club con merchandising, camisetas y productos oficiales de Belgrano.','https://maps.google.com/?q=Patio+Olmos+Shopping+Cordoba',1,0,'2025-06-24 21:30:38','2025-06-27 13:09:53'),(7,'Tienda Oficial Belgrano - Estadio','Av. Arturo Orgaz 510, Córdoba, Argentina','Tienda oficial ubicada en el estadio, abierta los días de partido y horarios especiales.','https://maps.google.com/?q=Estadio+Belgrano+Tienda+Oficial+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(8,'Hotel de Concentración','Alta Córdoba, Córdoba, Argentina','Hotel donde se concentra habitualmente el plantel profesional antes de los partidos importantes.','https://maps.google.com/?q=Hotel+Alta+Cordoba+Argentina',1,1,'2025-06-24 21:30:38','2025-06-25 00:38:38'),(9,'Centro Médico del Club','Av. Arturo Orgaz 505, Córdoba, Argentina','Centro médico especializado en medicina deportiva para jugadores y socios del club.','https://maps.google.com/?q=Centro+Medico+Belgrano+Orgaz+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(10,'Monumento a los Hinchas','Av. Arturo Orgaz, Córdoba, Argentina','Monumento dedicado a la hinchada de Belgrano, lugar de encuentro antes de los partidos.','https://maps.google.com/?q=Monumento+Hinchas+Belgrano+Orgaz+Cordoba',1,1,'2025-06-24 21:30:38','2025-06-24 21:30:38'),(11,'utn','utn','nada','https://maps.app.goo.gl/tNo4cyDzbvhGxBPN6',9,0,'2025-06-27 23:20:02','2025-11-28 23:24:11'),(12,'bETU','BATY','','https://maps.app.goo.gl/sN1pohys4ezpYiX36',9,1,'2025-12-06 00:11:24','2025-12-06 00:11:24');
