INSERT INTO `news` VALUES (1,1,'Belgrano se prepara para el clásico cordobés','El Pirata ultima detalles para enfrentar a Talleres en el Mario Alberto Kempes. El equipo dirigido por Guillermo Farré viene de una buena racha y busca mantener el invicto en casa.',1,'2025-06-10',0,'2025-06-12 03:48:03','2025-06-28 19:47:40'),(2,2,'Próximo partido: Belgrano vs Racing','Este domingo 15 de junio, Belgrano recibe a Racing Club en el estadio Julio César Villagra. Las entradas ya están disponibles.',1,'2025-06-08',1,'2025-06-12 03:48:03','2025-06-12 03:48:03'),(3,3,'Llega refuerzo para el mediocampo','La dirigencia confirmó la incorporación del volante central Matías Suárez, quien jugará con la camiseta celeste hasta diciembre de 2025.',1,'2025-06-05',1,'2025-06-12 03:48:03','2025-06-12 03:48:03'),(4,4,'Festival Pirata 2025','Se viene la tercera edición del Festival Pirata con shows en vivo, actividades para toda la familia y mucha diversión en los predios del club.',1,'2025-06-12',0,'2025-06-12 03:48:03','2025-06-27 08:38:49'),(5,1,'HOLA BELGRANO','HOLAAA',1,'2025-06-12',0,'2025-06-12 09:56:17','2025-06-24 22:58:19'),(6,2,'HOLA PROBANDO','Buenos dias',1,'2025-06-12',0,'2025-06-12 10:15:28','2025-06-24 22:58:48'),(7,5,'Fichaje Estrella Chino Zellarayan','Chino a Belgrano, el ídolo pirata vuelve a casa.',1,'2025-06-24',0,'2025-06-24 23:00:16','2025-06-27 13:14:44'),(8,1,'Belgrano presenta su nueva camiseta para la temporada 2025','El Club Atlético Belgrano presentó oficialmente su nueva indumentaria para la temporada 2025. El diseño celeste tradicional incorpora detalles modernos que honran la historia del Pirata. La camiseta ya está disponible en la tienda oficial del estadio y en el Patio Olmos. Los hinchas podrán adquirirla con descuentos especiales para socios.',1,'2025-06-28',1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(9,1,'Obras de mejora en el estadio Julio César Villagra','La dirigencia anunció importantes obras de remodelación en el estadio que incluyen mejoras en la iluminación LED, renovación de baños y ampliación de la tienda oficial. Las obras comenzarán en julio y estarán terminadas antes del Derby Cordobés contra Talleres.',1,'2025-06-29',1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(10,3,'Lucas Zelarrayán cerca de volver a Belgrano','El mediocampista cordobés Lucas Zelarrayán está muy cerca de regresar al Pirata. Las negociaciones con Columbus Crew de la MLS están avanzadas y el jugador ya expresó su deseo de volver a casa. Sería el refuerzo más importante de la historia reciente del club.',1,'2025-06-30',1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(11,3,'Llega nuevo delantero: Mateo Retegui en la mira','La dirigencia está negociando la llegada del delantero Mateo Retegui como refuerzo para la segunda mitad del año. El goleador de 25 años viene de destacarse en el fútbol europeo y sería una incorporación de jerarquía para el ataque pirata.',1,'2025-07-01',0,'2025-06-27 05:29:05','2025-06-27 08:38:36'),(12,2,'Se agotaron las entradas para el superclásico contra Boca','En solo 3 horas se agotaron todas las localidades para el partido contra Boca Juniors del 15 de julio. Más de 28.000 hinchas piratas acompañarán al equipo en el Gigante de Alberdi. Se espera un marco espectacular en uno de los partidos más importantes del año.',2,'2025-07-02',1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(13,2,'Derby Cordobés: la ciudad se prepara para el clásico','Córdoba se viste de celeste y azul para el Derby Cordobés del 16 de agosto. Tanto Belgrano como Talleres llegan en buen momento futbolístico, lo que promete un espectáculo único. Las entradas para hinchas de Belgrano salen a la venta esta semana.',2,'2025-07-03',0,'2025-06-27 05:29:05','2025-06-27 08:38:29'),(14,4,'Festival Pirata 2025: música, fútbol y diversión','Se viene la cuarta edición del Festival Pirata en los predios del club. Habrá shows en vivo de Los Auténticos Decadentes, La Bersuit y artistas locales. También actividades para chicos, food trucks y exhibiciones de fútbol. Entradas en venta desde $5.000.',4,'2025-07-04',1,'2025-06-27 05:29:05','2025-06-27 05:29:05'),(15,4,'Escuela de fútbol: abren las inscripciones 2025','Ya están abiertas las inscripciones para la Escuela de Fútbol Belgrano 2025. Dirigida a niños de 4 a 16 años, cuenta con profesores especializados y la posibilidad de entrenar en el mismo predio donde entrena el primer equipo. Becas disponibles para familias de bajos recursos.',4,'2025-07-05',0,'2025-06-27 05:29:05','2025-06-27 08:38:20'),(16,5,'Belgrano apoya la campaña \"Fútbol contra la violencia\"','El Club Atlético Belgrano se suma oficialmente a la campaña nacional \"Fútbol contra la violencia\". Se implementarán nuevas medidas de seguridad en el estadio y programas educativos para promover el fair play entre los hinchas.',5,'2025-07-06',1,'2025-06-27 05:29:05','2025-06-27 13:14:56'),(17,5,'Nuevo convenio con universidades cordobesas','Belgrano firmó convenios con la UNC y la UTN para ofrecer becas de estudio a jugadores de las divisiones inferiores. El programa \"Piratas con Futuro\" busca que los jóvenes talentos puedan desarrollarse deportiva y académicamente.',5,'2025-07-07',0,'2025-06-27 05:29:05','2025-06-27 08:38:06'),(18,3,'Hola Oscar','PROBANDO DDDDDDDDDDDDDDDDDDDDDDDD',9,'2025-06-27',0,'2025-06-27 23:16:14','2025-06-27 23:16:34'),(19,3,'Holas','Buenos dias hhdhdhdhhd',9,'2025-12-05',0,'2025-12-06 00:08:24','2026-01-07 03:54:48');
